import React from "react";
import { Pie } from "react-chartjs-2";
import { Chart as ChartJS, ArcElement, Tooltip, Legend } from "chart.js";
import { Box, Typography, Paper, List, ListItem, ListItemText } from "@mui/material";

ChartJS.register(ArcElement, Tooltip, Legend);

const AshaDashboard = () => {
  
  const diseaseData = {
    labels: ["Fever", "Cough", "Headache", "Stomach Pain", "Other"],
    datasets: [
      {
        data: [30, 20, 15, 10, 25], 
        backgroundColor: ["#FF6384", "#36A2EB", "#FFCE56", "#4BC0C0", "#9966FF"],
      },
    ],
  };


  const total = diseaseData.datasets[0].data.reduce((sum, value) => sum + value, 0);
  const percentages = diseaseData.datasets[0].data.map(
    (value) => ((value / total) * 100).toFixed(2) + "%"
  );

  
  const prescriptions = [
    { id: 1, patient: "Dipti Mam ", prescription: "Take Paracetamol for fever." },
    { id: 2, patient: "Aniket Mhatre ", prescription: "Take Patanjali Jadi Buti  for Project Headache." },
    { id: 3, patient: "Shruti Chavre ", prescription: "Take Brunofin for Cold." },
    { id: 4, patient: "Tanisha Paras ", prescription: "Take Dolo-65 for Headache." },
    
  ];

  return (
    <Box sx={{ padding: 3 }}>
      <Typography variant="h4" gutterBottom>
        Asha Worker Dashboard
      </Typography>

      <Paper sx={{ padding: 3, marginBottom: 3 }}>
        <Typography variant="h6" gutterBottom>
          Disease Distribution
        </Typography>
        <Box sx={{ display: "flex", alignItems: "center", gap: 4 }}>
          {/* Pie Chart */}
          <Box sx={{ width: "300px", height: "300px" }}>
            <Pie data={diseaseData} />
          </Box>

          {/* Percentage List */}
          <Box>
            <Typography variant="h6" gutterBottom>
              Disease Percentages
            </Typography>
            <List>
              {diseaseData.labels.map((label, index) => (
                <ListItem key={index}>
                  <ListItemText
                    primary={`${label}: ${percentages[index]}`}
                  />
                </ListItem>
              ))}
            </List>
          </Box>
        </Box>
      </Paper>

      <Paper sx={{ padding: 3 }}>
        <Typography variant="h6" gutterBottom>
          Prescriptions
        </Typography>
        <List>
          {prescriptions.map((prescription) => (
            <ListItem key={prescription.id}>
              <ListItemText
                primary={prescription.patient}
                secondary={prescription.prescription}
              />
            </ListItem>
          ))}
        </List>
      </Paper>
    </Box>
  );
};

export default AshaDashboard;
